We need to set our internal mGain with its required value from the host. This is the first step of the process method. Parse the parameter change coming from the host in the structure data.inputParameterChanges for the current audio block to process. Be sure to add #include "public.sdk/source/vst/vstaudioprocessoralgo.h at top of the file plugprocessor.cpp! This includes some helpers to access audio buffer. plugprocessor.cpp #include "pluginterfaces/vst/ivstparameterchanges.h"
#include "public.sdk/source/vst/vstaudioprocessoralgo.h" /----------------------------------------------------------------------------
tresult PLUGIN_API PlugProcessor::process (Vst::ProcessData&data)
{ //--- First : Read inputs parameter changes----------- if (data.inputParameterChanges) { // for each parameter defined by its ID int32 numParamsChanged = data.inputParameterChanges->getParameterCount (); for (int32 index = 0; index < numParamsChanged; index++) { // for this parameter we could iterate the list of value changes (could 1 per audio block or more!) // in this example we get only the last value (getPointCount - 1) Vst::IParamValueQueue* paramQueue = data.inputParameterChanges->getParameterData (index); if (paramQueue) { Vst::ParamValue value; int32 sampleOffset; int32 numPoints = paramQueue->getPointCount (); switch (paramQueue->getParameterId ()) { case GainParams::kParamGainId: if (paramQueue->getPoint (numPoints - 1, sampleOffset, value) == kResultTrue) mGain = value; break; } } } } // ....
} ⓘ Note data.inputParameterChanges can include more than 1 change for the same parameter inside a processing audio block. Here we take only the last change in the list and apply it our mGain . The real processing part: plugprocessor.cpp // ... //-- Flush case: we only need to update parameter, noprocessing possible
if (data.numInputs == 0 || data.numSamples == 0) return kResultOk; //--- Here you have to implement your processing
int32 numChannels = data.inputs[0].numChannels; //---get audio buffers using helper-functions(vstaudioprocessoralgo.h)-------------
uint32 sampleFramesSize = getSampleFramesSizeInBytes(processSetup, data.numSamples);
void** in = getChannelBuffersPointer (processSetup, datainputs[0]);
void** out = getChannelBuffersPointer (processSetup, dataoutputs[0]); // Here could check the silent flags
// now we will produce the output
// mark our outputs has not silent
data.outputs[0].silenceFlags = 0; float gain = mGain;
// for each channel (left and right)
for (int32 i = 0; i < numChannels; i++)
{ int32 samples = data.numSamples; Vst::Sample32* ptrIn = (Vst::Sample32*)in[i]; Vst::Sample32* ptrOut = (Vst::Sample32*)out[i]; Vst::Sample32 tmp; // for each sample in this channel while (--samples >= 0) { // apply gain tmp = (*ptrIn++) * gain; (*ptrOut++) = tmp; }
}
//... VST 3 includes a way for the host to inform the plug-in that its inputs are silent (using the VST 3 silence flags ): plugprocessor.cpp // Here could check the silent flags
//---check if silence---------------
// normally we have to check each channel (simplification)
if (data.inputs[0].silenceFlags != 0)
{ // mark output silence too data.outputs[0].silenceFlags = data.inputs[0].silenceFlags; // the Plug-in has to be sure that if it sets the flags silence that the output buffer are clear for (int32 i = 0; i < numChannels; i++) { // do not need to be cleared if the buffers are the same (in this case input buffer are // already cleared by the host) if (in[i] != out[i]) { memset (out[i], 0, sampleFramesSize); } } // nothing to do at this point return kResultOk;
}

