The Processor part represents the state of the plug-in, so it is its job to implement the getState / setState method used by the host to save/load projects and presets. In the file plugprocessor.cpp , add the mGain value to the state stream given by the host in the getState method which will save it as a project or preset. plugprocessor.cpp /-----------------------------------------------------------------------
tresult PLUGIN_API PlugProcessor::getState (IBStream* state)
{ // here we need to save the model (preset or project) float toSaveParam1 = mGain; IBStreamer streamer (state, kLittleEndian); streamer.writeFloat (toSaveParam1); return kResultOk;
} In the setState() method, the plug-in receives a new state (called after a project or preset is loaded) from the host. plugprocessor.cpp /-----------------------------------------------------------------------
tresult PLUGIN_API PlugProcessor::setState (IBStream* state)
{ if (!state) return kResultFalse; // called when we load a preset or project, the model has to be reloaded IBStreamer streamer (state, kLittleEndian); float savedParam1 = 0.f; if (streamer.readFloat (savedParam1) == false) return kResultFalse; mGain = savedParam1; return kResultOk;
}

