In our example we want to modulate our main audio input with a Side-chain audio input. First add a new side-chain audio input (busType: kAux ) in the initialize call of our processor: plugprocessor.cpp /-----------------------------------------------------------------------
tresult PLUGIN_API PlugProcessor::initialize (FUnknown*context)
{ //---always initialize the parent------- tresult result = AudioEffect::initialize (context); // if everything Ok, continue if (result != kResultOk) { return result; } //.... //---create Event In/Out busses (1 bus with only 1 channel)------ addEventInput (STR16 ("Event In"), 1); // create a Mono SideChain input bus addAudioInput (STR16 ("Mono Aux In"), Steinberg::Vst::SpeakerArr::kMono, Steinberg::Vst::kAux, 0); return kResultOk;
} We want to be sure that our side-chain is handled as mono input. For this we need to overwrite the AudioEffect::setBusArrangements function: plugprocessor.h /-----------------------------------------------------------------------
class PlugProcessor: public AudioEffect
{
public: PlugProcessor(); //... // overwrite this function Steinberg::tresult PLUGIN_API setBusArrangements (Steinberg::Vst::SpeakerArrangement* inputs, Steinberg::int32 numIns, Steinberg::Vst::SpeakerArrangement* outputs, Steinberg::int32 numOuts) SMTG_OVERRIDE; //...
}; plugprocessor.cpp /-----------------------------------------------------------------------
tresult PLUGIN_API PlugProcessor::setBusArrangements(Vst::SpeakerArrangement* inputs, int32 numIns, Vst::SpeakerArrangement* outputs, int32 numOuts)
{ // the first input is the Main Input and the second is the SideChain Input // be sure that we have 2 inputs and 1 output if (numIns == 2 && numOuts == 1) { // we support only when Main input has the same number of channel than the output if (Vst::SpeakerArr::getChannelCount (inputs[0]) != Vst::SpeakerArr::getChannelCount (outputs[0])) return kResultFalse; // we are agree with all arrangement for Main Input and output // then apply them getAudioInput (0)->setArrangement (inputs[0]); getAudioOutput (0)->setArrangement (outputs[0]); // Now check if sidechain is mono (we support in our example only mono Side-chain) if (Vst::SpeakerArr::getChannelCount (inputs[1]) != 1) return kResultFalse; // OK the Side-chain is mono, we accept this by returning kResultTrue return kResultTrue; } // we do not accept what the host wants : return kResultFalse ! return kResultFalse;
} Adapt our process using the side-chain input as modulation: /-----------------------------------------------------------------------
tresult PLUGIN_API PlugProcessor::process (ProcessData& data)
{ //--- First : Read inputs parameter changes----------- //... //---Second : Read input events------------- //... float gain = mGain - mGainReduction; if (gain < 0.f) // gain should always positive or zero gain = 0.f; void** auxIn = nullptr; // Check if the Side-chain input is activated bool auxActive = false; if (getAudioInput (1)->isActive ()) { auxIn = getChannelBuffersPointer (processSetup, data.inputs[1]); auxActive = true; } if (auxActive) { // for each channel (left and right) for (int32 i = 0; i < numChannels; i++) { int32 samples = data.numSamples; Vst::Sample32* ptrIn = (Vst::Sample32*)in[i]; Vst::Sample32* ptrOut = (Vst::Sample32*)out[i]; // Side-chain is mono, so take auxIn[0]: index 0 Vst::Sample32* ptrAux = (Vst::Sample32*)auxIn[0]; Vst::Sample32 tmp; // for each sample in this channel while (--samples >= 0) { // apply modulation and gain tmp = (*ptrIn++) * (*ptrAux++) * gain; (*ptrOut++) = tmp; } } } else { // for each channel (left and right) for (int32 i = 0; i < numChannels; i++) { int32 samples = data.numSamples; Vst::Sample32* ptrIn = (Vst::Sample32*)in[i]; Vst::Sample32* ptrOut = (Vst::Sample32*)out[i]; Vst::Sample32 tmp; // for each sample in this channel while (--samples >= 0) { // apply gain tmp = (*ptrIn++) * gain; (*ptrOut++) = tmp; } } } That´s it!

