If you have created your project with the VST 3 Project Generator and check the " Use VSTGUI " you can directly jump to Part 2 of this tutorial. Before using the inline UI editor, you must make sure that you use the Steinberg::Vst::EditController class as a base of your own edit controller and that you have used the Steinberg::Vst::Parameter class or any subclass of it for your parameters. Otherwise the inline UI editor won't work properly. Next you have to add vstgui to your project. For cmake users, you can just add the vstgui_support library to your target: target_link_libraries(${target} PRIVATE vstgui_support) If you are not using cmake, you have to manually include the following source files to your project: vstgui/vstgui_[ios/mac/linux/win32].[cpp/mm] vstgui/vstgui_uidescription.cpp vstgui/plugin-bindings/vst3editor.cpp After that you have to alter your project settings to add a preprocessor definition to your debug build: VSTGUI_LIVE_EDITING=1 With cmake , this would look like this: target_compile_definitions(${target} PUBLIC$<$<CONFIG:Debug>:VSTGUI_LIVE_EDITING=1>) Finally, you have to modify your edit controller class to overwrite the createView() method: #include "vstgui/plugin-bindings/vst3editor.h" IPlugView* PLUGIN_API MyEditController::createView (FIDStringname)
{ if (strcmp (name, ViewType::kEditor) == 0) { return new VSTGUI::VST3Editor (this, "view", "myEditor.uidesc"); } return 0;
} Also make sure to include the vst3editor.h header. Now you can build your plug-in and start your preferred VST 3 host to start designing your user interface.

