We will start by looking at this process function: void MyEffect::process (ProcessData& data)
{ handleParameterChanges (data.inputParameterChanges); // get the gain value for this block ParamValue gain = gainParameter.getValue (); // process audio AudioBusBuffers* inputs = data.inputs; AudioBusBuffers* outputs = data.outputs; for (auto channelIndex = 0; channelIndex < inputs[0].numChannels; ++channelIndex) { for (auto sampleIndex = 0; sampleIndex < data.numSamples; ++sampleIndex) { auto sample = inputs[0].channelBuffers32[channelIndex][sampleIndex]; outputs[0].channelBuffers32[channelIndex][sampleIndex] = sample * gain; } }
} This is straight and simple, we handle the parameter changes in the function handleParameterChanges , which we will see in a moment. Then we get the last gain parameter value and iterate over the input buffers and copy the samples from there to the output buffers and apply the gain factor. If we look at the handleParameterChanges function: void MyEffect::handleParameterChanges (IParameterChanges*changes)
{ if (!changes) return; int32 changeCount = changes->getParameterCount (); for (auto i = 0; i < changeCount; ++i) { if (auto queue = changes->getParameterData (i)) { auto paramID = queue->getParameterId (); if (paramID == ParameterID::Gain) { int32 pointCount = queue->getPointCount (); if (pointCount > 0) { int32 sampleOffset; ParamValue value; if (queue->getPoint (pointCount - 1, sampleOffset, value) == kResultTrue) gainParameter.setValue (value); } } } }
} We see that the Gain parameter only uses the last point for the gain value. If we now want to use all points of the Gain parameter we can use two utility classes from the SDK. The first one is the ProcessDataSlicer which slices the audio block into smaller peaces. void MyEffect::process (ProcessData& data)
{ handleParameterChanges (data.inputParameterChanges); ProcessDataSlicer slicer (8); auto doProcessing = [this] (ProcessData& data) { // get the gain value for this block ParamValue gain = gainParameter.getValue (); // process audio AudioBusBuffers* inputs = data.inputs; AudioBusBuffers* outputs = data.outputs; for (auto channelIndex = 0; channelIndex < inputs[0].numChannels; ++channelIndex) { for (auto sampleIndex = 0; sampleIndex < data.numSamples; ++sampleIndex) { auto sample = inputs[0].channelBuffers32[channelIndex][sampleIndex]; outputs[0].channelBuffers32[channelIndex][sampleIndex] = sample * gain; } } } slicer.process<SymbolicSampleSizes::kSample32> (data, doProcessing);
} As you see we have moved the algorithm part into a lambda doProcessing which is passed to slicer.process . This lambda is now called multiple times with a maximum of 8 samples per call until the whole buffer is processed. This doesn't give us yet a better parameter resolution, but we can now use the second utility class to handle this. At first we now look at the type of the gainParameter variable as this is our next utility class: SampleAccurate::Parameter gainParameter; We have to change the handleParameterChanges function to: void MyEffect::handleParameterChanges (IParameterChanges*inputParameterChanges)
{ int32 changeCount = inputParameterChanges->getParameterCount (); for (auto i = 0; i < changeCount; ++i) { if (auto queue = changes->getParameterData (i)) { auto paramID = queue->getParameterId (); if (paramID == ParameterID::Gain) { gainParameter.beginChanges (queue); } } } } to delegate the handling of the parameter changes to the gainParameter object. Now we just need another small change in the process lambda to use the nearly sample accurate gain value. We have to call the gainParameter object to advance the parameter value: auto doProcessing = [this] (ProcessData& data) { // get the gain value for this block ParamValue gain = gainParameter.advance (data.numSamples); // process audio AudioBusBuffers* inputs = data.inputs; AudioBusBuffers* outputs = data.outputs; for (auto channelIndex = 0; channelIndex < inputs[0].numChannels; ++channelIndex) { for (auto sampleIndex = 0; sampleIndex < data.numSamples; ++sampleIndex) { auto sample = inputs[0].channelBuffers32[channelIndex][sampleIndex]; outputs[0].channelBuffers32[channelIndex][sampleIndex] = sample * gain; } }
} Finally we have to do some cleanup of the gainParameter at the end of the process function by calling gainParameter.endChanges . void MyEffect::process (ProcessData& data)
{ handleParameterChanges (data.inputParameterChanges); ProcessDataSlicer slicer (8); auto doProcessing = [this] (ProcessData& data) { // get the gain value for this block ParamValue gain = gainParameter.advance (data.numSamples); // process audio AudioBusBuffers* inputs = data.inputs; AudioBusBuffers* outputs = data.outputs; for (auto channelIndex = 0; channelIndex < inputs[0].numChannels; ++channelIndex) { for (auto sampleIndex = 0; sampleIndex < data.numSamples; ++sampleIndex) { auto sample = inputs[0].channelBuffers32[channelIndex][sampleIndex]; outputs[0].channelBuffers32[channelIndex][sampleIndex] = sample * gain; } } } slicer.process<SymbolicSampleSizes::kSample32> (data, doProcessing); gainParameter.endChanges ();
} Now we have nearly sample accurate parameter changes support in this example. Every 8 samples the gain parameter will be updated to the correct value. It's very simple to make this 100% sample accurate, check out the AGain sample accurate example in the SDK.

