The example currently only supports 32 bit processing. Now we will add 64 bit processing. As you may have noticed above the ProcessDataSlicer uses a template parameter for its process function. This template parameter SampleSize defines the bit depth of the audio buffers in the ProcessData structure. This is currently hard-coded to be SymbolicSampleSizes::kSample32 . In order to support SymbolicSampleSizes::kSample64 we only have to make a few changes to the code. First we adopt the algorithm part by introducing a new templated method to our effect: template <SymbolicSampleSizes SampleSize>
void MyEffect::process (ProcessData& data)
{
} We mostly just move the code from the original process method to this one except the code for handling parameter changes: template <SymbolicSampleSizes SampleSize>
void MyEffect::process (ProcessData& data)
{ ProcessDataSlicer slicer (8); auto doProcessing = [this] (ProcessData& data) { // get the gain value for this block ParamValue gain = gainParameter.advance (data.numSamples); // process audio AudioBusBuffers* inputs = data.inputs; AudioBusBuffers* outputs = data.outputs; for (auto channelIndex = 0; channelIndex < inputs[0].numChannels; ++channelIndex) { for (auto sampleIndex = 0; sampleIndex < data.numSamples; ++sampleIndex) { auto sample = inputs[0].channelBuffers32[channelIndex][sampleIndex]; outputs[0].channelBuffers32[channelIndex][sampleIndex] = sample * gain; } } } slicer.process<SampleSize> (data, doProcessing);
} We just change the template parameter SampleSize of the process method of the ProcessDataSlicer to use the same template parameter as of our own process function. This will not work correctly yet as we still work with the 32 bit audio buffers in our doProcessing lambda. In order to fix this we have to introduce two more templated functions getChannelBuffers that will choose the correct audio buffers depending on the SampleSize template parameter, which can either be SymbolicSampleSizes::kSample32 or SymbolicSampleSizes::kSample64 : template <SymbolicSampleSizes SampleSize, typename std::enable_if<SampleSize == SymbolicSampleSizes::kSample32>::type* = nullptr>
inline Sample32** getChannelBuffers (AudioBusBuffers& buffer)
{ return buffer.channelBuffers32;
} template <SymbolicSampleSizes SampleSize, typename std::enable_if<SampleSize == SymbolicSampleSizes::kSample64>::type* = nullptr>
inline Sample64** getChannelBuffers (AudioBusBuffers& buffer)
{ return buffer.channelBuffers64;
} Now we can change our doProcessing algorithm to use these functions: template <SymbolicSampleSizes SampleSize>
void MyEffect::process (ProcessData& data)
{ ProcessDataSlicer slicer (8); auto doProcessing = [this] (ProcessData& data) { // get the gain value for this block ParamValue gain = gainParameter.advance (data.numSamples); // process audio AudioBusBuffers* inputs = data.inputs; AudioBusBuffers* outputs = data.outputs; for (auto channelIndex = 0; channelIndex < inputs[0].numChannels; ++channelIndex) { auto inputBuffers = getChannelBuffers<SampleSize> (inputs[0])[channelIndex]; auto outputBuffers = getChannelBuffers<SampleSize> (outputs[0])[channelIndex]; for (auto sampleIndex = 0; sampleIndex < data.numSamples; ++sampleIndex) { auto sample = inputBuffers[sampleIndex]; outputBuffers[sampleIndex] = sample * gain; } } }; slicer.process<SampleSize> (data, doProcessing);
} As a final step we now need to call the templated process<...> function from the normal process function: void MyEffect::process (ProcessData& data)
{ handleParameterChanges (data.inputParameterChanges); if (processSetup.symbolicSampleSize == SymbolicSampleSizes::kSample32) process<SymbolicSampleSizes::kSample32> (data); else process<SymbolicSampleSizes::kSample64> (data); gainParameter.endChanges ();
} Depending on the processSetup.symbolicSampleSize we either call the 32 bit process function or the 64 bit process function. We just have to inform the host that we can process 64 bit: tresult PLUGIN_API MyEffect::canProcessSampleSize (int32symbolicSampleSize)
{ return (symbolicSampleSize == SymbolicSampleSizes::kSample32 || symbolicSampleSize == SymbolicSampleSizes::kSample64) ? kResultTrue : kResultFalse;
} Now we have sample accurate parameter changes and 32 and 64 bit audio processing.

