One common issue in this domain is that the plug-in state coming from a preset or a DAW project is set by the host from a non realtime thread. If we want to change our internal data model to use this state we have to transfer this state to the realtime thread. This should be done in a realtime thread safe manner otherwise the model may not reflect the correct state as parameter changes dispatched in the realtime thread and the state data set on another thread will end in an undefined state. For this case we have another utility class: RTTransferT This class expects to have a template parameter StateModel describing the state data. We create a simple struct as data model: struct StateModel
{ double gain;
}; using RTTransfer = RTTransferT<StateModel>; We use RTTransfer now as a member for our MyEffect class: class MyEffect : ....
{ RTTransfer stateTransfer;
}; If we now get a new state from the host, we create a newStateModel and write the stateGain value into model->gain andpass it to the utility class stateTransfer : tresult PLUGIN_API MyEffect::setState (IBStream* state)
{ double stateGain = ... // read this out of the state stream StateModel model = std::make_unique<StateModel> (); model->gain = stateGain; stateTransfer.transferObject_ui (std::move (model)); return kResultTrue;
} To get the stateModel into our realtime thread we have to change the process function like this: void MyEffect::process (ProcessData& data)
{ stateTransfer.accessTransferObject_rt ([this] (const auto& stateModel) { gainParameter.setValue (stateModel.gain); }); handleParameterChanges (data.inputParameterChanges); if (processSetup.symbolicSampleSize == SymbolicSampleSizes::kSample32) process<SymbolicSampleSizes::kSample32> (data); else process<SymbolicSampleSizes::kSample64> (data); gainParameter.endChanges (); return kResultTrue;
} The accessTransferObject_rt function will check if there is a new model state and will call the lambda if it is and then we can set our gainParameter to the value of stateModel.gain . To free up the memory in the stateTransfer object we have to call the clear_ui method of it. In this case where we only have one double as state model it is OK to hold onto it until the next state is set or the effect is terminated. So we just add it to the terminate method of the plugin: tresult PLUGIN_API MyEffect::terminate ()
{ stateTransfer.clear_ui (); return AudioEffect::terminate ();
} If the model data uses more memory and you want to get rid of it earlier you have to use a timer or similar to call the clear_ui method a little bit after the setState method was called. But this is not the scope of this tutorial. And that's it now. The complete source code can be found here: public.sdk/samples/vst/again_sampleaccurate/source/tutorial.cpp If you want to use the utility classes, you will find them here: public.sdk/source/vst/utility/processdataslicer.h public.sdk/source/vst/utility/sampleaccurate.h public.sdk/source/vst/utility/rttransfer.h That´s it!

