{ // we accept only the first bus and 1 channel and only 2 keyswitches if (busIndex == 0 && channel == 0 && (keySwitchIndex == 0 || keySwitchIndex == 1) { memset (&info, 0, sizeof (KeyswitchInfo)); // in this case we want that Keyswitch should be maintained pressed for playing info.typeId = kKeyRangeTypeID; // we could use keyRemapped to make easier the use of the keyswitch (near the available instrument key range) // take care that there are no overlap between keyswitches and real key (playing sound) if (keySwitchIndex == 0) { USTRING ("Accentuation").copyTo (info.title, 128); USTRING ("Acc").copyTo (info.shortTitle, 128); // if the user keeps pressed C-1 or C#-1 or C-0 then the Accentuation sound should be played info.keyswitchMin = 12; // C-1 info.keyswitchMax = 13; // C#-1 info.keyRemapped = 24; // C-0 } else { USTRING ("Softly").copyTo (info.title, 128); USTRING ("Soft").copyTo (info.shortTitle, 128); // if the user keeps pressed D-1 or D#-1 or D-0 then the Softly sound should be played info.keyswitchMin = 14; // D-1 info.keyswitchMax = 15; // D#-1 info.keyRemapped = 26; // D-0 } info.unitID = -1; // not used info.flags = 0; // not used return kResultTrue; } return kResultFalse;
} Last step, in the processor component, we have to adapt the process call to switch to the wanted articulation: // ------------------------------------------------------------------ ------
tresult MyExampleProcessor::process (ProcessData& data)
{ // .... // get the input event queue IEventList* inputEvents = data.inputEvents; if (inputEvents) { Event e; int32 numEvents = inputEvents->getEventCount (); // for each events check it.. for (int32 i = 0; i < numEvents; i++) { if (inputEvents->getEvent (i, e) == kResultTrue) { switch (e.type) { //----------------------- case Event::kNoteOnEvent: { // here a note On // check if this is a Keyswitch switch (e.noteOn.pitch) { // Accentuation Keyswitch case 12: case 13: case 24: currentLayer = kAccentuationLayer; break; // Softly Keyswitch case 14: case 15: case 26: currentLayer = kSoftlyLayer; break; default: // play the note in the currentLayer // ... } } break; //----------------------- case Event::kNoteOffEvent: { // check if keyswitch is released switch (e.noteOff.pitch) { // Accentuation Keyswitch case 12: case 13: case 24: case 14: case 15: case 26: currentLayer = kDefaultLayer; break; default: // released note... //... } } break; //.... } } } } //...
} That is it!

